//  SVG path data for body muscle groups
//  Migrated from react-native-body-highlighter with absolute coordinates
//

import Foundation

// MARK: - Muscle Slug

enum MuscleSlug: String, CaseIterable, Identifiable {
    case chest
    case abs
    case biceps
    case triceps
    case deltoids
    case quadriceps
    case hamstring
    case calves
    case gluteal
    case trapezius
    case upperback = "upper-back"
    case lowerback = "lower-back"
    case obliques
    case neck
    case forearm
    case adductors
    case knees
    case tibialis
    case ankles
    case feet
    case hands
    case head
    case hair

    var id: String { rawValue }

    // User-friendly display name
    var displayName: String {
        switch self {
        case .chest: return "Chest"
        case .abs: return "Abs"
        case .biceps: return "Biceps"
        case .triceps: return "Triceps"
        case .deltoids: return "Shoulders"
        case .quadriceps: return "Quads"
        case .hamstring: return "Hamstrings"
        case .calves: return "Calves"
        case .gluteal: return "Glutes"
        case .trapezius: return "Trapezius"
        case .upperback: return "Upper Back"
        case .lowerback: return "Lower Back"
        case .obliques: return "Obliques"
        case .neck: return "Neck"
        case .forearm: return "Forearms"
        case .adductors: return "Adductors"
        case .knees: return "Knees"
        case .tibialis: return "Tibialis"
        case .ankles: return "Ankles"
        case .feet: return "Feet"
        case .hands: return "Hands"
        case .head: return "Head"
        case .hair: return "Hair"
        }
    }

    // Whether this muscle is selectable by users
    var isSelectable: Bool {
        switch self {
        case .chest, .abs, .biceps, .triceps, .deltoids, .quadriceps,
             .hamstring, .calves, .gluteal, .trapezius, .upperback,
             .lowerback, .obliques, .forearm:
            return true
        default:
            return false
        }
    }

    // Map to questionnaire muscle group names
    var questionnaireGroupName: String? {
        switch self {
        case .chest: return "Chest"
        case .deltoids: return "Shoulders"
        case .upperback, .lowerback, .trapezius: return "Back"
        case .triceps: return "Triceps"
        case .biceps: return "Biceps"
        case .abs, .obliques: return "Abs"
        case .quadriceps: return "Quads"
        case .hamstring: return "Hamstrings"
        case .gluteal: return "Glutes"
        case .calves: return "Calves"
        case .forearm: return "Forearms"
        default: return nil
        }
    }
}

// MARK: - Muscle Part

struct MusclePart: Identifiable {
    let slug: MuscleSlug
    let defaultColor: String
    let paths: MusclePathGroup

    var id: String { slug.rawValue }
}

// MARK: - Muscle Path Group

struct MusclePathGroup {
    let common: [String]
    let left: [String]
    let right: [String]

    init(common: [String] = [], left: [String] = [], right: [String] = []) {
        self.common = common
        self.left = left
        self.right = right
    }

    var allPaths: [String] {
        common + left + right
    }
}

